import React from 'react'

const MoodCard = ({mood, color, onClick}) => {
  return (
    <div
      onClick={onClick}
      className={`${color} rounded-lg p-6 cursor-pointer transform transition-all hover:scale-105 hover:shadow-xl`}
    >
      <h3 className="text-xl font-bold text-white text-center">{mood}</h3>
    </div>
  )
}

export default MoodCard
